import React from 'react'
import data from '../data/data'
const Home = () => {
  return (
    <div className='grid '>
      <div className=''>

        {
          data.mobilePhones.map((mobile) => {
            return (
              <div className='grid sm:grid-cols-1'>

                  <div className="mda">
                    <h3> {
                      mobile.name
                    }</h3>

                    <div className="mda">
                      <img src="/images/galaxya.jpg" alt={mobile.name} />
                    </div>


                    <div className="mda">
                      {mobile.price}
                    </div>
                    <div className="mda"></div>


                  </div>


                
              
              </div>

            )
          })
        }

      </div>
    </div>
  )
}

export default Home
